import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container,
  } from "@mui/material";

  function HomePage() {
    return (
      <Container
        fixed
        sx={{
          bgcolor: "grey",
          marginTop: '10vh', 
          marginBottom: '10vh',
          width: "100%",
          height: "100vh",
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'space-between',
        }}
      >
        <Box sx={{ flex: 1, textAlign: 'center' }}> {/* Left box */}
          <Box name="center-left">
            <h1>Hi,</h1>
            <h1>I'm Nemanja</h1>
            <Button>About me</Button>
          </Box>
        </Box>
        <Box sx={{ flex: 1, textAlign: 'center' }}> {/* Right box */}
          <h1>Right</h1>
        </Box>
      </Container>
    );
  }

  export default HomePage;
